var SlimeyStack=function(){this.stack=[],this.size=0};SlimeyStack.prototype.push=function(e){this.stack[this.size++]=e},SlimeyStack.prototype.pop=function(){return this.size==0?null:this.stack[--this.size]},SlimeyStack.prototype.peek=function(){return this.size==0?null:this.stack[this.size-1]},SlimeyStack.prototype.getSize=function(){return this.size},SlimeyStack.prototype.isEmpty=function(){return this.size==0},SlimeyStack.prototype.clear=function(){this.size=0};